const Icons = (iconValue) => {
  switch (iconValue) {
    case "instagram":
      return "data:image/svg+xml;base64,";
      break;
    case "facebook":
      return "data:image/svg+xml;base64,";
      break;
    case "twitter":
      return "data:image/svg+xml;base64,";
      break;
    case "linkedin":
      return "data:image/svg+xml;base64,";
      break;
    case "mail":
      return "data:image/svg+xml;base64,";
      break;
    case "whatsapp":
      return "data:image/svg+xml;base64,";
      break;
    case "telegram":
      return "data:image/svg+xml;base64,";
      break;
      case "socialMedia":
        return "data:image/png;base64,";
      break;

      case "edit":
        return "data:image/png;base64,";
        break;

    default:
      return "data:image/svg+xml;base64,";
  }
};

export default Icons;
